<template>
    <div class="containerMap">
        <div id="mapView" ref="map"></div>
        <location
                :view="view"
                @location="setPosition"
                @locationfailed="cantSetPosition"
                class="location"></location>
        <myLocation class="myLocationContainer"></myLocation>
    </div>
</template>

<script>
    import axios from 'axios';
    import esriLoader from 'esri-loader';
    import location from './location';
    import myLocation from './MyLocation';
    import configMap from './configMap';
    import {arcgisToGeoJSON} from '@esri/arcgis-to-geojson-utils';
    import {geojsonToArcGIS} from '@esri/arcgis-to-geojson-utils';

    export default {
        name: "Map",
        components: {
            location,
            myLocation
        },
        data() {
            return {
                map: null,
                view: null,
                url: 'https://js.arcgis.com/4.10/',
                viewReady: false,
                defaultUi: {},
                Point: null,
                geometryEngine: null,
                Graphic: null,
                buffer: null,
                GraphicsLayer: null,
                bufferLayer: null,
                axios: null,
                webMercatorUtils: null,
                features: null,
                PictureMarkerSymbol: null,
                geojsonToArcGIS,
                action: 'take',
                amount: 1000,
            };
        },
        methods: {
            setPosition(position) {
                this.view.goTo({
                    center: [position.coords.longitude, position.coords.latitude],
                    zoom: 15,
                }, {
                    duration: 500
                });
            },
            cantSetPosition() {
                alert('невозможно определить позицию');
            },
            createSendObject(geometry) {
                return {
                    type: "FeatureCollection",
                    metadata: {
                        name: "Зона доступности",
                        creator: "Приложение",
                        action: this.action,
                        amount: this.amount
                    },
                    features: [
                        {
                            type: "Feature",
                            id: 0,
                            geometry,
                            properties: {
                                "description": "Описание",
                                "fill": "#ed4543",
                                "fill-opacity": 0.6,
                                "stroke": "#ed4543",
                                "stroke-width": "5",
                                "stroke-opacity": 0.9
                            }
                        }
                    ]
                }
            },
            createBuffer() {
                return this.geometryEngine.geodesicBuffer(this.view.center.clone(), 1000, "meters");
            },
            getATM() {
                this.bufferLayer.removeAll();
                const buffer = this.createBuffer();
                const geojson = arcgisToGeoJSON(this.webMercatorUtils.webMercatorToGeographic(buffer));
                axios.post(configMap.getURLServer(),
                    this.createSendObject(geojson),
                    {
                        headers: {
                            'Access-Control-Allow-Credentials': true,
                            "Access-Control-Allow-Origin": "*"
                        }
                    }).then(this.handleRequest)
                    .catch((error) => console.log(error));
            },
            handleRequest(resp) {
                if (resp.data.features.length){
                    this.features = resp.data.features;
                    this.$emit('newFeatures', this.features);
                    this.showFeatures();
                }
            },
            showFeatures() {
                this.features.forEach(function (feature) {
                    var markerSymbol = {
                        type: "picture-marker",  // autocasts as new PictureMarkerSymbol()
                        url: "data:image/png;base64,",
                        width: "32px",
                        height: "32px"
                    };
                    const pointGraphic = new this.Graphic({
                        geometry: new this.Point(feature.geometry.coordinates[0], feature.geometry.coordinates[1]),
                        symbol: markerSymbol
                    });
                    this.bufferLayer.add(pointGraphic);
                }.bind(this));
            },
            showATM(object) {
                const showObject = this.features.find((feature) => {
                    return feature.properties.CompanyMetaData.id === object.id;
                });
                console.log(showObject);
            }
        },
        mounted() {
            esriLoader.loadModules(['esri/views/MapView',
                'esri/Map',
                'esri/geometry/Point',
                'esri/geometry/geometryEngine',
                'esri/Graphic',
                'esri/layers/GraphicsLayer',
                'esri/geometry/support/webMercatorUtils',
                'esri/symbols/PictureMarkerSymbol'])
                .then(([MapView,
                           Map,
                           Point,
                           geometryEngine,
                           Graphic,
                           GraphicsLayer,
                           webMercatorUtils,
                           PictureMarkerSymbol]) => {
                    this.map = new Map({
                        basemap: "streets"
                    });
                    this.view = new MapView({
                        container: this.$refs.map,
                        map: this.map,
                        zoom: 15,
                        center: [37.600531, 55.751666],
                    });
                    this.view.when(() => {
                        this.viewReady = true;

                        if (navigator.geolocation) {
                            navigator.geolocation
                                .getCurrentPosition(
                                    this.setPosition,
                                    () => this.setPosition({
                                        coords: {
                                            longitude: 37.531342,
                                            latitude: 55.741432,
                                        }
                                    }));
                        } else {
                            this.cantSetPosition();
                        }
                        this.bufferLayer = new GraphicsLayer();
                        this.map.add(this.bufferLayer);
                    });

                    this.view.constraints = {
                        rotationEnabled: false
                    };
                    this.Point = Point;
                    this.geometryEngine = geometryEngine;
                    this.Graphic = Graphic;
                    this.GraphicsLayer = GraphicsLayer;
                    this.webMercatorUtils = webMercatorUtils;
                    this.PictureMarkerSymbol = PictureMarkerSymbol;
                })
                .catch(err => {
                    console.error(err);
                });
        },
        created() {
            esriLoader.loadCss('https://js.arcgis.com/4.10/esri/css/main.css');
            this.$bus.$on('getATM', this.getATM);
            this.$bus.$on('showFeature', this.showATM);
        }
    }
</script>
